const Header = ({
  className, 
  data
}) => {
  return (
    <header 
      className={className ? className : 'header'} 
      data-name={data.name}
    >
      <div className={`${className}__wrapper`}>
        <nav className={`${className}__nav`}></nav>
        <button></button>
        <button></button>
      </div>
    </header>
  )
}

export default Header
